import React from 'react';

const Menu = ({ menu }) => {
  return (
    <ul>
    <li>
      {menu.menu}  
      {menu.subMenus && menu.subMenus.length > 0 && (
        <ul>
          {menu.subMenus.map(subMenu => (
            <Menu key={subMenu.id} menu={subMenu} />
          ))}
          {menu.menu_item}
        </ul>
      )}
    </li>
    </ul>

  );
};

export default Menu;
